	"\u672c\u4f5c\u4f9d\u7ae0\u7bc0\u6a19\u984c\u4f86\u6c7a\u5b9a\u7ae0\u7bc0\u7de8\u865f\uff1b\u5efa\u8b70\u8a2d\u7f6e recheck=multi_parts_changed \u9078\u9805\u4f86\u907f\u514d\u591a\u6b21\u4e0b\u8f09\u6642\uff0c\u9047\u4e0a\u7f3a\u8a71\u7684\u60c5\u6cc1\u3002": "Cette section d\u00e9termine le num\u00e9ro de chapitre selon le titre du chapitre. Il est recommand\u00e9 de d\u00e9finir l\u2019option \u00ab\u202f`recheck=multi_parts_changed`\u202f\u00bb pour \u00e9viter une situation manqu\u00e9e lors de t\u00e9l\u00e9chargements \u00e0 multiples reprises.",
	"\u300a%1\u300b\u51fa\u73fe\u7ae0\u7bc0\u7de8\u865f\u5012\u7f6e\u7684\u60c5\u6cc1\uff1a%2": "Dans le cas de \u00ab\u202f%1\u202f\u00bb, le num\u00e9ro de chapitre est invers\u00e9\u202f: %2",
