	"\u4f9d\u5e8f\u5c07\u7ae0\u7bc0\u5e8f\u865f\u8a2d\u5b9a\u70ba %1\u3002": "D\u00e9finit le num\u00e9ro de chapitre \u00e0 %1 d\u2019apr\u00e8s l\u2019ordre du chapitre.",
