	"\u672c\u4f5c\u5b58\u6709\u4e0d\u540c\u7684 part\uff1b\u5efa\u8b70\u8a2d\u7f6e recheck=multi_parts_changed \u9078\u9805\u4f86\u907f\u514d\u591a\u6b21\u4e0b\u8f09\u6642\uff0c\u9047\u4e0a\u7f3a\u8a71\u7684\u60c5\u6cc1\u3002": "Cette \u0153uvre a une partie diff\u00e9rente. Il est recommand\u00e9 de d\u00e9finir l\u2019option \u00ab\u202f`recheck=multi_parts_changed`\u202f\u00bb pour \u00e9viter une situation manqu\u00e9e lors de t\u00e9l\u00e9chargements \u00e0 multiples reprises.",
