	"MESSAGE_NEED_RE_DOWNLOAD": "Le t\u00e9l\u00e9chargement s'est mal pass\u00e9\u202f; cela peut \u00eatre caus\u00e9 par le fait que le serveur est temporairement indisponible ou que le fichier est perdu ou non trouv\u00e9 (404). Veuillez confirmer que la cause de l\u2019erreur a \u00e9t\u00e9 \u00e9limin\u00e9e ou ne se produit plus avant d\u2019ex\u00e9cuter \u00e0 nouveau pour poursuivre le t\u00e9l\u00e9chargement.",
	"Retry %1/%2": "Nouvelle tentative %1 sur %2",
	"\u56e0\u5feb\u53d6\u6a94\u6848\u58de\u4e86\uff08\u4f8b\u5982\u70ba\u7a7a\u6a94\u6848\uff09\uff0c\u5c07\u91cd\u65b0\u53d6\u5f97 chapter_URL\uff0c\u8a2d\u5b9a .reget_chapter\u3002": "Puisque le fichier en cache est rompu (par exemple, un fichier vide), l\u2019URL du chapitre (chapter_URL) sera r\u00e9cup\u00e9r\u00e9e et l\u2019indicateur \u00ab\u202f.reget_chapter\u202f\u00bb sera positionn\u00e9.",
	"\u7ae0\u7bc0\u7de8\u865f\u4f9d\u5e8f\u61c9\u70ba %1\uff0c\u4f46\u7121\u6cd5\u81ea\u7ae0\u7bc0\u5167\u5bb9\u53d6\u5f97\u7de8\u865f\u3002": "Le num\u00e9ro de chapitre devrait \u00eatre %1 dans l\u2019ordre, mais le num\u00e9ro ne peut \u00eatre obtenu depuis le contenu du chapitre.",
	"\u7ae0\u7bc0\u7de8\u865f\u4e0d\u4e00\u81f4\uff1a\u4f9d\u5e8f\u61c9\u70ba %1\uff0c\u4f46\u5f9e\u5167\u5bb9\u64f7\u53d6\u51fa %2\u3002": "Les num\u00e9ros de chapitres sont incoh\u00e9rents\u202f: dans l\u2019ordre on devrait trouver %1, mais \u00ab\u202f%2\u202f\u00bb est obtenu du contenu.",
