	"\u53ef\u80fd\u56e0\u70ba\u4f5c\u54c1\u4e0b\u8f09\u76ee\u9304\u6539\u8b8a\u4e86\uff0c\u800c\u5feb\u53d6\u8cc7\u6599\u6307\u5411\u4e0d\u5b58\u5728\u7684\u820a\u4f4d\u7f6e\u3002": "Cela peut d\u00fb au fait que le r\u00e9pertoire de t\u00e9l\u00e9chargement de l\u2019\u0153uvre a chang\u00e9 et que les donn\u00e9es en cache pointent vers l\u2019ancien emplacement qui n\u2019existe pas.",
	"\u53ef\u80fd\u56e0\u70ba\u4f5c\u54c1\u8cc7\u8a0a\u5feb\u53d6\u8207\u7576\u524d\u7db2\u7ad9\u4e0a\u4e4b\u4f5c\u54c1\u7ae0\u7bc0\u7d50\u69cb\u4e0d\u540c\u3002": "Cela peut \u00eatre d\u00fb au fait que le cache des informations sur l\u2019\u0153uvre est diff\u00e9rent de la structure du chapitre de l\u2019\u0153uvre sur le site actuel.",
