	"\u60a8\u5fc5\u9808\u8a2d\u5b9a skip_error \u6216 allow_EOI_error \u9078\u9805\uff0c\u624d\u6703\u5132\u5b58\u640d\u58de\u7684\u6a94\u6848\u3002": "Vous devez d\u00e9finir l\u2019option \u00ab\u202fskip_error\u202f\u00bb ou \u00ab\u202fallow_EOI_error\u202f\u00bb pour stocker les fichiers corrompus.",
