	"\u5728 %1 \u4e4b\u524d\uff08\u9084\u6709 %2\uff09\u53ef\u4ee5\u95b1\u8b80\u672c\u7ae0\u7bc0\u300a%3\u300b\u3002": "Vous pouvez lire \u00ab\u202f%3\u202f\u00bb dans cette section avant %1 (et %2).",
	"\u4e4b\u524d\u5df2\u4e0b\u8f09\u904e\u7ae0\u7bc0\u300a%1\u300b\uff0c\u4e0d\u518d\u91cd\u65b0\u8cfc\u8cb7\u3002": "La section \u00ab\u202f%1\u202f\u00bb a \u00e9t\u00e9 t\u00e9l\u00e9charg\u00e9e auparavant et ne sera pas achet\u00e9e \u00e0 nouveau.",
	"\u672c\u7ae0\u7bc0\u72c0\u6cc1\u4e0d\u660e(%1)\u3002\u8df3\u904e\u300a%1\u300b\u4e0d\u63a1\u7528\u95b1\u8b80\u5377\u3002": "L\u2019\u00e9tat de ce chapitre est inconnu (%1). Sauter \u00ab\u202f%1\u202f\u00bb n\u2019utilise pas la lecture de volumes.",
	"\u672a\u8a2d\u5b9a\u8b93\u672c\u5de5\u5177\u81ea\u52d5\u4f7f\u7528\u95b1\u8b80\u5377\u3002\u82e5\u60a8\u4e26\u975e\u4f7f\u7528\u5b89\u88dd\u5305\uff0c\u4e26\u60f3\u8981\u8b93\u672c\u5de5\u5177\u81ea\u52d5\u4f7f\u7528\u95b1\u8b80\u5377\uff0c\u8acb\u6253\u958b\u6a94\u6848\u7e3d\u7ba1\uff0c\u5230\u5b89\u88dd\u672c\u5de5\u5177\u7684\u76ee\u9304\u4e0b\uff08\u82e5\u662f\u60a8\u4f7f\u7528\u5b89\u88dd\u5305\uff0c\u5c31\u4e0d\u80fd\u5920\u8a2d\u5b9a\u5e33\u865f\u5bc6\u78bc\u4e86\u3002\uff09\uff0c\u5728 work_crawler.configuration.js \u9019\u500b\u6a94\u6848\u4e2d\u8a2d\u5b9a\u597d\u5e33\u865f\u5bc6\u78bc\u8cc7\u6599\uff0c\u4ee5\u53ca \"auto_use_ticket:true\"\u3002\u60a8\u53ef\u4ee5\u53c3\u8003 work_crawler.default_configuration.js \u9019\u500b\u6a94\u6848\u4f86\u505a\u8a2d\u5b9a\u3002": "L\u2019outil n\u2019est pas positionn\u00e9 pour utiliser automatiquement le volume en lecture. Si vous n\u2019utilisez pas le paquet d\u2019installation et si vous voulez que l\u2019outil utilise automatiquement le volume en lecture, veuillez ouvrer le gestionnaire de fichiers et allez dans le r\u00e9pertoire o\u00f9 l\u2019outil est install\u00e9 (si vous utilisez le paquet d\u2019installation, vous ne pouvez pas d\u00e9finir le mot de passe du compte). Indiquez les informations du mot de passe du compte dans le fichier JavaScript de configuration \u00ab\u202fwork_crawler.configuration.js\u202f\u00bb et d\u00e9finissez-y \u00ab\u202fauto_use_ticket:true\u202f\u00bb. Vous pouvez vous r\u00e9f\u00e9rer au fichier \u00ab\u202fwork_crawler.default_configuration.js\u202f\u00bb pour la configuration.",
	"\u7528\u95b1\u8b80\u5238\u95b1\u8b80\u300a%1\u300b\u3002": "Lecture de \u00ab\u202f%1\u202f\u00bb avec un coupon de lecture.",
