	"\u4e0b\u8f09\u6642\u767c\u751f\u932f\u8aa4\uff0c\u7121\u6cd5\u9806\u5229\u53d6\u5f97\u6a94\u6848\u5167\u5bb9\uff01": "Une erreur s\u2019est produite durant le t\u00e9l\u00e9chargement et les contenus des fichiers n\u2019ont pas pu \u00eatre correctement obtenus\u202f!",
