	"\u6216\u8a31\u662f\u4e0b\u8f09\u7684\u6a94\u6848\u51fa\u73fe\u932f\u8aa4\uff1f\u60a8\u53ef\u5617\u8a66\u904e\u6bb5\u6642\u9593\u518d\u4e0b\u8f09\uff0c\u6216\u9078\u7528 .recheck \u9078\u9805\u4f86\u5ffd\u7565\u5feb\u53d6\u3001\u91cd\u65b0\u4e0b\u8f09\u6bcf\u500b\u5716\u7247\u7684\u9801\u9762\u3002": "Peut-\u00eatre le fichier t\u00e9l\u00e9charg\u00e9 a-t-il une erreur\u202f? Vous pouvez essayer de le t\u00e9l\u00e9charger plus tard, ou bien utiliser l\u2019option \u00ab\u202f.recheck\u202f\u00bb pour ignorer le cache et t\u00e9l\u00e9charger \u00e0 nouveau la page pour chaque image.",
