	"\u5df2\u8a2d\u5b9a .recheck \u9078\u9805\uff0c\u4e14\u4e4b\u524d\u66fe\u4e0b\u8f09\u904e\u672c\u4f5c\u54c1\uff0c\u4f5c\u54c1\u76ee\u9304\u6709\u5167\u5bb9\u3002": "L\u2019option \u00ab\u202f.recheck\u202f\u00bb n\u2019a pas \u00e9t\u00e9 positionn\u00e9e, l\u2019\u0153uvre a \u00e9t\u00e9 t\u00e9l\u00e9charg\u00e9e auparavant et le catalogue a du contenu.",
	"\u65e2\u5df2\u8a2d\u5b9a .recheck \u9078\u9805\uff0c\u5247\u5c07 .reget_chapter \u9078\u9805\u8a2d\u5b9a\u70ba %1 \u5c07\u7121\u4f5c\u7528\uff01": "Avec l\u2019option \u00ab\u202f.recheck\u202f\u00bb positionn\u00e9e,  d\u00e9finir l\u2019option \u00ab\u202f.reget_chapter\u202f\u00bb \u00e0 \u00ab\u202f%1\u202f\u00bb n\u2019aura aucun effet\u202f!",
	"\u5c07\u81ea\u52d5\u628a .reget_chapter \u8f49\u70ba true\uff0c\u660e\u78ba\u6307\u5b9a reget_chapter \u4ee5\u91cd\u65b0\u53d6\u5f97\u7ae0\u7bc0\u5167\u5bb9\u3002": "Cela passera automatiquement \u00ab\u202f.reget_chapter\u202f\u00bb \u00e0 \u00ab\u202ftrue\u202f\u00bb (vrai) pour explicitement sp\u00e9cifier de r\u00e9acqu\u00e9rir le contenu du chapitre.",
	"\u4f5c\u54c1\u8b8a\u66f4\u904e\uff0c\u4e14\u7b26\u5408\u9700\u8981\u66f4\u65b0\u7684\u689d\u4ef6\u3002": "L\u2019\u0153uvre a \u00e9t\u00e9 modifi\u00e9e et est sujette aux conditions qui n\u00e9cessitent sa mise \u00e0 jour.",
	"\u56e0\u7ae0\u7bc0\u6578\u91cf\u6709\u8b8a\u5316\uff0c\u5c07\u91cd\u65b0\u4e0b\u8f09\u4e26\u6aa2\u67e5\u6240\u6709\u7ae0\u7bc0\u5167\u5bb9\uff1a": "Puisque le nombre de chapitre change, tous les chapitres seront t\u00e9l\u00e9charg\u00e9s \u00e0 nouveau et v\u00e9rifi\u00e9s\u202f:",
	"\u7ae0\u7bc0\u6578\u91cf\u7121\u8b8a\u5316\uff0c\u5171 %1 %2\uff1b": "Le nombre de chapitres n\u2019a pas chang\u00e9, au total %1 %2\u202f;",
	"\u7ae0\u7bc0\u6578\u91cf\u8b8a\u5316\u904e\u5c0f\uff08\u50c5\u5dee %1 %2\uff09\uff0c\u56e0\u6b64\u4e0d\u91cd\u65b0\u4e0b\u8f09\uff1b": "Le nombre de chapitre a l\u00e9g\u00e8rement chang\u00e9 (de seulement %1 %2), ils ne seront pas tous t\u00e9l\u00e9charg\u00e9s \u00e0 nouveau\u202f;",
