	"\u50c5\u5229\u7528\u5feb\u53d6\u91cd\u5efa\u8cc7\u6599\uff08\u5982\u5c0f\u8aaa\u3001\u96fb\u5b50\u66f8\uff09\uff0c\u4e0d\u91cd\u65b0\u4e0b\u8f09\u6240\u6709\u7ae0\u7bc0\u5167\u5bb9\u3002": "Reconstruit les donn\u00e9es seulement avec le cache (par exemple pour les nouvelles et livres \u00e9lectroniques) et ne t\u00e9l\u00e9charge pas \u00e0 nouveau le contenu de tous les chapitres.",
