	"\u4e4b\u524d\u5df2\u4e0b\u8f09\u5230\u8f03\u65b0\u7684\u7b2c %2 %3\uff0c\u56e0\u6307\u5b9a start_chapter_title=%1 \u800c\u56de\u6eaf\u3002": "Le t\u00e9l\u00e9chargement jusqu\u2019au chapitre %2 %3 plus r\u00e9cent a eu lieu auparavant, d\u2019apr\u00e8s la sp\u00e9cification de \u00ab\u202fstart_chapter_title=%1\u202f\u00bb.",
	"\u4e4b\u524d\u5df2\u4e0b\u8f09\u5230\u8f03\u65b0\u7684\u7b2c %2 %3\uff0c\u56e0\u6307\u5b9a start_chapter_NO=%1 \u800c\u56de\u6eaf\u3002": "Le t\u00e9l\u00e9chargement jusqu\u2019au chapitre %2 %3 plus r\u00e9cent a eu lieu auparavant, d\u2019apr\u00e8s la sp\u00e9cification de \u00ab\u202fstart_chapter_NO=%1\u202f\u00bb.",
	"\u7ae0\u7bc0\u6578\u91cf %1 \u6bd4\u5c07\u958b\u59cb/\u63a5\u7e8c\u4e4b\u4e0b\u8f09\u7ae0\u7bc0\u7de8\u865f %2 \u9084\u5c11\uff0c\u6216\u8a31\u56e0\u70ba\u7ae0\u7bc0\u6709\u7d93\u904e\u91cd\u6574\uff0c\u6216\u8005\u4e0a\u6b21\u4e0b\u8f09\u6642\u4e2d\u9014\u589e\u522a\u904e\u7ae0\u7bc0\u3002": "Le nombre de chapitres %1 est inf\u00e9rieur au num\u00e9ro de chapitre %2 de d\u00e9but ou reprise du t\u00e9l\u00e9chargement, peut-\u00eatre parce que le chapitre a \u00e9t\u00e9 r\u00e9organis\u00e9 ou que le chapitre a \u00e9t\u00e9 ajout\u00e9 ou supprim\u00e9 entre temps durant le dernier t\u00e9l\u00e9chargement.",
	"\u5c07\u5148\u5099\u4efd\u820a\u5167\u5bb9\u3001\u79fb\u52d5\u76ee\u9304\uff0c\u800c\u5f8c\u91cd\u65b0\u81ea\u7b2c %1 %2\u4e0b\u8f09\uff01": "L\u2019ancien contenu sera sauvegard\u00e9, son r\u00e9pertoire sera d\u00e9plac\u00e9, puis le t\u00e9l\u00e9chargement reprendra depuis %1 %2\u202f!",
