	"download_options.MIN_LENGTH": "Taille minimale de fichier d\u2019image (en octets). Si la valeur est trop petite, l\u2019image cass\u00e9e qui est transmise pourrait \u00eatre trait\u00e9e comme une image normale sans erreur.",
