	"download_options.recheck": "Tous les chapitres et les images de tous les travaux sont d\u00e9tect\u00e9s. Mais une image termin\u00e9e ne sera pas \u00e0 nouveau t\u00e9l\u00e9charg\u00e9e. Quand \u00ab\u202fmulti_parts_changed\u202f\u00bb est d\u00e9fini, cela ne sera rev\u00e9rifi\u00e9 QUE s\u2019il y a plusieurs parties.",
